
/****************************  Doner Serranito ********************************************************************

Doner Serranito es una base de datos para una cadena de establecimientos que sirven comida a domicilio.
Los clientes se registran en la base de datos.
Cada pedido está formado por uno o más platos. Cada plato es un serranito y debe especificar el tipo de pan y el tipo de carne que lo forman.
Un plato puede incluir uno o varios tipos de salsas.
Además del seranito, se pueden incluir otros elementos adicionales como guarnición.
Además de los serranitos, un pedido puede incluir complementos como bebidas, postres, etc.
Los pedidos son entregados por los repartidores.
El precio de cada serranito son 4€, a los que se sumarán los complementos y adicionales que pida el cliente.

*******************************************************************************************************************/
