/****** Object:  Table [dbo].[DSAdicionales]    ******/

CREATE TABLE DSAdicionales(
	ID tinyint NOT NULL,
	Adicional varchar(20) NOT NULL,
	Importe smallmoney NULL,
 CONSTRAINT PKAdicional PRIMARY KEY (ID)
)


/****** Object:  Table [dbo].[DSClientes]    ******/

CREATE TABLE DSClientes(
	ID int NOT NULL,
	Nombre varchar(20) NOT NULL,
	Apellidos varchar(30) NOT NULL,
	Direccion varchar(50) NOT NULL,
	Ciudad varchar(20) NOT NULL,
	Telefono1 char(9) NOT NULL,
	Telefono2 char(9) NULL,
 CONSTRAINT PKCliente PRIMARY KEY (ID)
)

/****** Object:  Table [dbo].[DSComplementos]     ******/

CREATE TABLE DSComplementos(
	[ID] [tinyint] NOT NULL,
	[Complemento] [varchar](20) NOT NULL,
	[Importe] [smallmoney] NULL,
 CONSTRAINT PKComplemento PRIMARY KEY (ID)
)

/****** Object:  Table [dbo].[DSEstablecimientos]     ******/

CREATE TABLE DSEstablecimientos(
	[ID] [smallint] NOT NULL,
	[Denominacion] [varchar](30) NOT NULL,
	[Direccion] [varchar](50) NOT NULL,
	[Ciudad] [varchar](20) NOT NULL,
	[Telefono] [char](9) NOT NULL,
 CONSTRAINT PKEstablecimiento PRIMARY KEY (ID)
)

/****** Object:  Table [dbo].[DSRepartidores]     ******/
CREATE TABLE DSRepartidores(
	[ID] [smallint] NOT NULL,
	[Nombre] [varchar](20) NOT NULL,
	[Apellidos] [varchar](30) NOT NULL,
	[Telefono] [char](9) NOT NULL,
	[IDEstablecimiento] [smallint] NOT NULL,
 CONSTRAINT PKRepartidor PRIMARY KEY (ID)
) 

/****** Object:  Table [dbo].[DSPedidos]     ******/
CREATE TABLE DSPedidos(
	[ID] [bigint] IDENTITY(1,1) NOT NULL,
	[Recibido] [smalldatetime] NOT NULL,
	[Enviado] [smalldatetime] NULL,
	[IDCliente] [int] NOT NULL,
	[IDEstablecimiento] [smallint] NULL,
	[IDRepartidor] [smallint] NULL,
	[Importe] [smallmoney] NULL,
	CONSTRAINT PKPedido PRIMARY KEY (ID),
	CONSTRAINT FKPedidoRepartidor FOREIGN KEY(IDRepartidor)
		REFERENCES DSRepartidores (ID)
)

/****** Object:  Table [dbo].[DSPedidosComplementos]     ******/
CREATE TABLE DSPedidosComplementos(
	[IDPedido] [bigint] NOT NULL,
	[IDComplemento] [tinyint] NOT NULL,
	[Cantidad] [tinyint] NOT NULL DEFAULT ((1)),
 CONSTRAINT PKPedidosComplementos PRIMARY KEY (IDPedido,IDComplemento)
)

/****** Object:  Table [dbo].[DSPlatos]     ******/
CREATE TABLE DSPlatos(
	[ID] [bigint] IDENTITY(1,1) NOT NULL,
	[IDPedido] [bigint] NOT NULL,
	[TipoPan] [char](9) NOT NULL,
	[TipoCarne] [char](12) NOT NULL,
 CONSTRAINT PKPlato PRIMARY KEY (ID)
)

/****** Object:  Table [dbo].[DSPlatosAdicionales]     ******/
CREATE TABLE DSPlatosAdicionales(
	[IDPlato] [bigint] NOT NULL,
	[IDAdicional] [tinyint] NOT NULL,
 CONSTRAINT PKPlatosAdicionales PRIMARY KEY (IDPlato,IDAdicional)
)


/****** Object:  Table [dbo].[DSPlatosSalsas]     ******/
CREATE TABLE DSPlatosSalsas(
	[IDPlato] [bigint] NOT NULL,
	[IDSalsa] [tinyint] NOT NULL,
 CONSTRAINT PKPlatosSalsas PRIMARY KEY (IDPlato,IDSalsa)
 )


/****** Object:  Table [dbo].[DSTiposCarne]     ******/
CREATE TABLE DSTiposCarne(
	[Carne] [char](12) NOT NULL,
 CONSTRAINT PKCarnes PRIMARY KEY (Carne)
) 

/****** Object:  Table [dbo].[DSTiposPan]     ******/
CREATE TABLE DSTiposPan(
	[Pan] [char](9) NOT NULL,
 CONSTRAINT PKPanes PRIMARY KEY (Pan)
)

/****** Object:  Table [dbo].[DSTiposSalsa]     ******/
CREATE TABLE DSTiposSalsa(
	[ID] [tinyint] NOT NULL,
	[Salsa] [varchar](12) NOT NULL,
 CONSTRAINT PKSalsa PRIMARY KEY (ID)
)


