/****** Object:  StoredProcedure [dbo].[GenerarPedidos]     ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
  -- Generar pedidos de forma aleatoria

  CREATE PROCEDURE [dbo].[GenerarPedidos] @n SmallInt AS
  BEGIN
	SET NoCount ON
	DECLARE @Cont SmallInt, @Cont2 SmallInt, @ComplementosDistintos TinyInt, @NumComplementos TinyInt, @ComplementoElegido TinyInt
	DECLARE @NumPlatos TinyInt, @IncrementoTiempo SmallInt, @Recibido SmallDateTime, @Enviado SmallDateTime
	DECLARE @Importe SmallMoney, @Total SmallMoney, @ImporteComplementos SmallMoney, @ImporteEsteComplemento SmallMoney
	DECLARE @Establecimiento SmallInt, @Cliente Int, @Repartidor SmallInt, @IdPedido BigInt
	DECLARE CClientes SCROLL CURSOR FOR SELECT ID From DSClientes
	OPEN CClientes
	SET @Cont = 1
	SET @ComplementosDistintos = 16
	While @Cont <= @n
	BEGIN
		-- Elegimos un cliente al azar
		FETCH NEXT FROM CClientes INTO @Cliente
		IF @@FETCH_STATUS = -1
			FETCH FIRST FROM CClientes INTO @Cliente
		-- Un establecimiento de su ciudad
		SELECT @Establecimiento = CASE WHEN @cont % 2 = 0 THEN MAX (E.ID) ELSE MIN(E.ID) END FROM DSEstablecimientos AS E JOIN DSClientes AS C ON E.Ciudad = C.Ciudad Where C.ID = @Cliente
		-- Y un repartidor de ese establecimiento
		SELECT @Repartidor = CASE WHEN @cont % 2 = 0 THEN MAX (ID) ELSE MIN(ID) END FROM DSRepartidores Where IDEstablecimiento = @Establecimiento
		-- Generamos las horas del pedido
		SET @IncrementoTiempo = Floor(RAND() * 29300)
		SET @Recibido = DATEADD (Hour, @IncrementoTiempo, SMALLDATETIMEFROMPARTS( 2012,1,1,0,0))
		SET @IncrementoTiempo = Floor(RAND() * 60)
		SET @Recibido = DATEADD (Minute, @IncrementoTiempo, @Recibido)
		SET @IncrementoTiempo = Floor(RAND() * 10) + 10
		SET @Enviado = DATEADD (Minute, @IncrementoTiempo, @Recibido)

		-- Insertamos el pedido y capturamos el ID
		INSERT INTO DSPedidos (Recibido, Enviado, IDCliente,IDEstablecimiento,IDRepartidor) VALUES (@Recibido, @Enviado,@Cliente,@Establecimiento,@Repartidor)
		SET @IdPedido = @@IDENTITY
		-- Generamos los platos, entre uno y cuatro
		SET @NumPlatos = Floor(RAND() * 4) + 1
		SET @Cont2 = 1
		SET @Total = 0
		While @Cont2 <= @NumPlatos
		BEGIN
			EXECUTE GenerarPlato @IdPedido, @Importe OUTPUT
			SET @Total = @Total + @Importe
			SET @Cont2 = @Cont2 + 1
		END
		-- Complementos
		SET @ImporteComplementos = 0
		SET @NumComplementos = FLOOR(RAND()*@Numplatos*2)+1
		SET @Cont2 = 1
		While @Cont2 <= @NumComplementos
		BEGIN
			SET @ComplementoElegido = FLOOR(RAND()*@ComplementosDistintos)+1
			IF NOT EXISTS (SELECT * FROM DSPedidosComplementos Where IDPedido = @IdPedido AND IDComplemento = @ComplementoElegido)
				INSERT INTO DSPedidosComplementos (IDPedido, IDComplemento, Cantidad) VALUES ( @IdPedido,@ComplementoElegido,1)
			ELSE
				UPDATE DSPedidosComplementos SET Cantidad = Cantidad + 1 Where IDPedido = @IdPedido AND IDComplemento = @ComplementoElegido
			SELECT @ImporteEsteComplemento = Importe FROM DSComplementos Where ID = @ComplementoElegido
			SET @ImporteComplementos = @ImporteComplementos + ISNULL (@ImporteEsteComplemento,0)
			SET @Cont2 = @Cont2 + 1
		END
		UPDATE DSPedidos SET Importe = @Total + @ImporteComplementos Where ID = @IdPedido
		SET @cont = @Cont + 1
	END --While
	CLOSE CClientes
	DEALLOCATE CCLientes
  END --GenerarPedidos

GO
