  -- GenerarPlatos de Forma Aleatoria
CREATE PROCEDURE [dbo].[GenerarPlato] @IdPedido BigInt, @Importe SmallMoney OUTPUT AS
BEGIN
	SET NoCount ON
	DECLARE @ComplementosDistintos TinyInt, @AdicionalesDistintos TinyInt, @PanesDistintos TinyInt, @CarnesDistintas TinyInt, @NumAdicional TinyInt
	DECLARE @Cont TinyInt, @NumAdicionales TinyInt, @NumSalsas TinyInt, @SalsaElegida TinyInt, @SalsasDistintas TinyInt
	DECLARE @CarneElegida TinyInt, @PanElegido TinyInt, @IDPlato BigInt
	DECLARE @Pan Char(9), @Carne Char(12), @PrecioBase SmallMoney, @ImporteAdicionales SmallMoney, @ImporteEsteAdicional SmallMoney
	SET @AdicionalesDistintos = 11
	SET @PrecioBase = 4
	-- Elegimos Pan
	SELECT @PanesDistintos = COUNT (*) From DSTiposPan
	DECLARE CPanes SCROLL CURSOR FOR SELECT Pan FROM DSTiposPan
	OPEN CPanes
	SET @PanElegido = FLOOR(RAND()*@PanesDistintos)+1
	FETCH ABSOLUTE @PanElegido FROM Cpanes INTO @Pan
	CLOSE CPanes
	DEALLOCATE CPanes
	-- Elegimos Carne
	SELECT @CarnesDistintas = COUNT (*) From DSTiposCarne
	DECLARE CCarnes SCROLL CURSOR FOR SELECT Carne FROM DSTiposCarne
	OPEN CCarnes
	SET @CarneElegida = FLOOR(RAND()*@CarnesDistintas)+1
	FETCH ABSOLUTE @CarneElegida FROM CCarnes INTO @Carne
	CLOSE CCarnes
	DEALLOCATE CCarnes
	INSERT INTO DSPlatos (IDPedido,TipoPan,TipoCarne) VALUES (@IdPedido, @Pan, @Carne)
	SET @IDPlato = @@IDENTITY
	-- Añadimos de 0 a 3 salsas
	SELECT @SalsasDistintas = COUNT(*) FROM DSTiposSalsa
	SET @NumSalsas = FLOOR(RAND()*4)
	SET @Cont = 1
	While @Cont <= @NumSalsas
	BEGIN
		SET @SalsaElegida = FLOOR(RAND()*@SalsasDistintas) +1
		-- Quitar repes
		IF NOT EXISTS (SELECT * FROM DSPlatosSalsas Where IDPlato = @IdPlato AND IDSalsa = @SalsaElegida)
		BEGIN
			INSERT INTO DSPlatosSalsas (IDPlato, IDSalsa) VALUES ( @IdPlato,@SalsaElegida)
		END
		SET @Cont = @Cont + 1
	END

	-- Elegimos de 0 a 3 adicionales
	SET @NumAdicionales = FLOOR(RAND()*5)
	SET @ImporteAdicionales = 0
	SET @Cont = 1
	While @Cont <= @NumAdicionales
	BEGIN
		SET @NumAdicional = FLOOR(RAND()*@AdicionalesDistintos) +1
		IF NOT EXISTS (SELECT * FROM DSPlatosAdicionales WHERE IDPlato =  @IdPlato AND IDAdicional = @NumAdicional)
		BEGIN
			INSERT INTO DSPlatosAdicionales (IDPlato, IDAdicional) VALUES ( @IdPlato,@NumAdicional)
			SELECT @ImporteEsteAdicional = ISNULL(Importe,0) FROM DSAdicionales Where ID = @NumAdicional
			SET @ImporteAdicionales = @ImporteAdicionales + @ImporteEsteAdicional
		END
		SET @Cont = @Cont + 1
	END
	SET @Importe = @PrecioBase + @ImporteAdicionales
END --GenerarPlato


